import React from 'react';

function List({ groceries = [] }) {
  return (
    <ul className="list-group">
      {groceries
        .filter((item) => !item.purchased)
        .map((item) => (
          <li >{item.name}</li>
        ))}
    </ul>
  );
}

export default List;
